import React from 'react';
import { MapContainer, TileLayer, Marker, Popup, Polyline } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';

function Mapa({ datosGeoJSON }) {
    console.log('datosGeoJSON----',datosGeoJSON)
  return (
    <MapContainer center={[51.505, -0.09]} zoom={13} style={{ height: '400px', width: '100%' }}>
      <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
      {/* Renderizar los puntos */}
      {datosGeoJSON.geojson.features.map((feature, index) => (
        <Marker key={index} position={[feature.geometry.coordinates[1], feature.geometry.coordinates[0]]}>
          <Popup>{feature.properties.name}</Popup>
        </Marker>
      ))}
      {/* Renderizar la l√≠nea */}
      <Polyline positions={datosGeoJSON.geojson.features.find(feature => feature.geometry.type === 'LineString').geometry.coordinates} />
    </MapContainer>
  );
}

export default Mapa;
